	'224829657 9584248006 9881895728 Россия, Краснодарский край, Сочи, Пластунская улица, 123 Краснодарский край Сочи Пластунская улица 123 д123 д 123 123д Центральный Макаренко район Раз Два Три ЖК жилой комплекс 3-комн. кв., 67 м², 20/25 этаж 3 комн комнатная 20 25 Новая 3х квартира -первая сдача.Распланирована на две раздельные спальни (с 2х спальной кроватью и разборным диваном)и зал с кухней столовой с разборным диваном.Укомплектована мебелью и всей бытовой техникой(посудомоечная машина ).Довозится мебель.Вид на речку.Длительно,дополнительно коммунальные.В каждом доме по 6 лифтов: 4 пассажирских и 2 грузовых.Подъезды, холлы и территория оборудованы видеонаблюдением и сигнализацией. На дверях подъездов  домофоны.Большая придомовая территория комплекса огорожена, благоустроена и озеленена, есть детские и спортивные площадки, много парковочных мест.С западной стороны жилого комплекса протекает живописная речка Сочи, с северной стороны  спорткомплекс Спартак и здание МЧС, с востока ЖК граничит с жилыми домами на Пластунской, на юге  здание ДПС.Поблизости находятся Сочинский государственный университет, две гимназии 6 и 15, детские сады 19 и 86, поликлиника, 4 продуктовых магазина и три торговых центра Моремолл,Олимп и Гипер-Магнит , буквально в 200 м  продуктовый рынок.До железнодорожного вокзала Сочи  3 км, до Морского порта и пляжа 4,5 км.Микрорайон, к которому относиться комплекс  Макаренко, но основная его часть находится выше ул. Пластунской и поэтому ЖК стоит несколько обособлено, там как-то не привычно просторно и не суетливо. Рядом с комплексом протекает река Сочи, вдоль которой можно гулять и наслаждаться видами и не громких шорохом реки. С верхних этажей комплекса открываются потрясающие панорамы на море, город и горы.По Пластунской ходят несколько автобусов, на которых можно добраться в любой конец города.На автомобиле, до Моремолла или ТЦ Олимп можно добраться за 5 мин, до ЖД Вокзала, Морпорта или центральных пляжей за 10-15 мин.До Адлерского аэропорта  25-30 мин.До горнолыжных курортов Красной поляны  около часа.',
